import React from "react";

export const New=()=>{
    return(
    <ul>
        <li>Hello</li>
        <li>sasi</li>
    </ul>
    )
}
export const Component4=()=>{
    return(
        <>
        <button type="button"
        onclick="document.getElementById('demo').innerHTML = Date()">
        Click me to display Date and Time.</button>
        
        <p id="demo"></p>
        </>
    )
}
export const Component5=()=>{
    
    return(
    <ul>
        <li>Hello</li>
        <li>sasi</li>
    </ul>
    )
}
export const Component6=()=>{
    
        
    return(
        <>
            <p style={{color:'blue',backgroundColor:'green',textTransform:'uppercase'}}>
                hello there!
            </p>
            <p>sasi</p>
            <hr color='blue'/>
            <h1>bootcamp frameworks</h1>
            <img src="images/sasi1.jpg"></img>
        </>
    )
}
